    <>
    <GoogleMap zoom={10} center={{ lat: 48.85341, lng: 2.3488 }} mapContainerClassName="map-container">

    <MarkerF position={{ lat: 48.85341, lng: 2.3488 }}/>
    </GoogleMap>
    </>
  );

}

